import React from "react";
import { Button, Container, Image, Row, Col } from "react-bootstrap";

import browser from "../../images/application-icon.png";
import greenBlockchain from '../../images/blockchain-icon-green.png'


const About = () => {
  return (
    <Container>
      <h1>A little bit about me...</h1>
      <Row>
        <Col></Col>
        <Col>
          <Image src={browser} className="img-fluid"/>
        </Col>
      </Row>
      <Image src={greenBlockchain} />
      <Button variant="primary">Primary</Button>
      <Button variant="outline-primary">Primary</Button>{" "}
    </Container>
  );
};

export default About;
